import React from 'react'
import './Pangsit.css'
const Pangsit = () => {
    return(
        <React.Fragment>
            <img className="pangsit1" src={require('../../assets/pangsit.png')} alt="pangsit" />
            <img className="pangsit2" src={require('../../assets/pangsit.png')} alt="pangsit" />
        </React.Fragment>
    )
}

export default Pangsit
